import React from "react";
import "../css/bootstrap.min.css";

const Dropdown = (props) => {
    const renderedOptions = props.options.map((option) => {
        return (
            <div>
                option.value
            </div>
        );
    });
    
    return <div>{renderedOptions}</div>;
}

export default Dropdown;
